import React, { useState } from 'react';

const App = () => {
  const [user, setUser] = useState('')

  const auth = () => {

    //let token = '781bd9f1de084f4daa7ba2aa8a71a2eab855354e'

    var token = new Promise((re, reg) => {
      var AuthToken = { username: 'test_super', password: 'Nf<U4f<rDbtDxAPn' }

      fetch('http://emphasoft-test-assignment.herokuapp.com/api-token-auth/', { method: 'POST', body: JSON.stringify(AuthToken), headers: { 'Content-Type': 'application/json' } })
        .then(e => re(e.text()))
        .catch(e => reg(e))
    })

    token.then(e => {
      fetch(`http://emphasoft-test-assignment.herokuapp.com/api/v1/users`, { method: 'GET', headers: { 'Authorization': `Token ${JSON.parse(e)}` } })
        .then(e2 => console.log(e2))
        .catch(e2 => console.log(e2))
    })
  }
  return (
    <div>
      <h1>{user}</h1>
      <input placeholder='name' type='text' onChange={e => setUser(e.target.value)} />

      <button onClick={() => auth()}>Auth</button>
    </div>
  );
}

export default App;
